import React from 'react'
import { useNavigate } from 'react-router-dom'

function OwnerMenu() {

    const navigate = useNavigate()




  return (
    <div className='owner-menu'>
        <nav >
            <button onClick={() => navigate('/owner/edit')}>Edit Your Info</button>
            <button onClick={() => navigate('/projects/create')}>Create Project</button>
            <button onClick={() => navigate('/projects')}>View Your Projects</button>
            <button onClick={() => navigate('/projects/collaborate')}>Your Crews</button>
        </nav>

    </div>
  )
}

export default OwnerMenu
